import React from 'react'
import Work from './images/image.jpg' 

const Work1 = () => {
  const sectionStyle = {
    background: `url('background-image.jpg')`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    height: '30vh',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  };

  const headingStyle = {
    color: '#ffffff',
    fontSize: '2rem',
    textTransform: 'uppercase',
    textAlign: 'center',
  };
  return (
    <section className="our-clients" style={sectionStyle}>
    <div className="container">
      <h2 className="text-center" style={headingStyle}>Our Work</h2>
      <div className="row">
        {/* Add the image elements and their respective styles */}
      </div>
      {/* Add the remaining rows */}
    </div>
  </section>
  )
}

export default Work1
